import React, { Component } from 'react';
class Main extends Component {
  render() {
    return (
        <main id="main">
    <Switch>
            <Route path="/automate" component={Automate} ></Route>
            <Route path="/camera" component={Camera} ></Route> 
            {/* <Route path="/logout">
              <Logout />
            </Route> */}
        </Switch>
  </main>
    );
  }
}

export default Main;
